### Important Lessons in Low-Latency Systems
1. **Use Fixed-Size Data Structures**: Prefer arrays or `Structs` over dynamic sizes.
2. **Avoid Locks**: Use lock-free algorithms or adjust your architecture for state to minimize contention.
3. **Batch Orders as Necessary**: Edward advantage of batching processes that can dominantly enhance performance.
4. **Real-time Updates**: Consider msg routing for updates even for aggregated trade data.

### Requirements Overview

If you want to simulate normal yet essential components of a low-cost trading platform, it must have:
* **Order Entry**: For buyers and sellers to enter orders.
* **Order Book**: Repositories that will maintain tree sequences of the orders.
* **Matching Engine**: A simplistic structure for casa inequity shifts on a basic buy/sell scenario.
* **API Pipelines**: REST/WebSocket for client endpoints for say 'striking/api).

